import React from 'react';
import { NavLink } from 'react-router-dom'


const Menu = () => {
    return (
        <>
            <div className='menu_style'>
                <NavLink exact activeClassName="active_class" to='/'>Home</NavLink>
                <NavLink exact activeClassName="active_class" to='/about'>About Us</NavLink>
                <NavLink exact activeClassName="active_class" to='/about/name'>Name</NavLink>
                <NavLink exact activeClassName="active_class" to='/contact/Rana/Jazz'>Contact Us</NavLink>
            </div>
        </>
    )
}
export default Menu;
